import React from "react";
import{Navbar, Nav, NavDropdown,Form,FormControl} from "react-bootstrap";
import logo from "../images/logo.png";
import {Link} from "react-router-dom";
import "./Navbar"

const PublicNavBar = () => {
  return (

      <Navbar className="fixed-top transition" bg="dark" variant="dark" expand="lg">
        <Navbar.Brand href="#home"><img src={logo} atl="logo" width="200"/></Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="mr-auto">
            <Nav.Link as={Link} to="/">Currently Playing</Nav.Link>
            <Nav.Link as={Link} to= "/movie/upcoming">Upcoming</Nav.Link>
            <Nav.Link as={Link} to= "/movie/top-rated">Top Rated</Nav.Link>
            <NavDropdown title="Sort" id="basic-nav-dropdown">
              {/* <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
              <NavDropdown.Item href="#action/3.2">
                Another action
              </NavDropdown.Item>
              <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href="#action/3.4">
                Separated link
              </NavDropdown.Item> */}
            </NavDropdown>
          </Nav>
          <Form inline>
            <FormControl type="text" placeholder="Search" className="mr-sm-2" />
          </Form>
        </Navbar.Collapse>
      </Navbar>

  );
};

export default PublicNavBar;
